import React, { useState } from 'react'
import './Styles.css'
import Envelope from '../assets/envelope-solid.svg'

const InputContainer = ({
  imageSrc,
  altText,
  inputType,
  placeholder,
  value,
  onChange,
  required,
  minLength,
}) => {
  return (
    <>
      <div className="email-container">
        <img src={imageSrc} alt="email" width="20px" height="20px" />
        <input
          placeholder={placeholder}
          type={inputType}
          value={value}
          onChange={onChange}
          required
          minLength={minLength}
        />
      </div>
    </>
  )
}

export default InputContainer
